import React from "react";
import {
  Box,
  Heading,
  Link,
  Image,
  Text,
  Divider,
  HStack,
  Tag,
  Wrap,
  WrapItem,
  SpaceProps,
  useColorModeValue,
  Container,
  VStack,
} from "@chakra-ui/react";
import HashnodeData from "../Data/hashnode.json";

const BlogSection = () => {
  return (
    <>
      {HashnodeData.posts.map(function (item, index) {
        return (
          <>
            <Box key={item.id}></Box>
          </>
        );
      })}
    </>
  );
};

export default BlogSection;
